import React, { useEffect } from 'react';
import { RiHomeFill, RiUser3Fill, RiMoneyDollarCircleFill, RiLoginCircleFill, RiLogoutCircleFill, RiTeamFill, RiShoppingCart2Fill, RiCurrencyFill, RiLineChartFill } from 'react-icons/ri';
import { initializeSidebar } from './sidebarEffects';
import './Aside.scss';

const Sidebar = () => {
  useEffect(() => {
    console.log('Inicializando sidebar');
    initializeSidebar();
    
    return () => {
      // Código de limpieza aquí si es necesario
    };
  }, []);

  // Recuperar y parsear la sesión desde localStorage
  const sesionString = localStorage.getItem("session");
  const sesion = sesionString ? JSON.parse(sesionString) : null;

  if (!sesion || !sesion.user) {
    console.error("No se encontró la sesión o el usuario en localStorage");
    return null;
  }

  console.log('Perfil del usuario:', sesion.user.perfil);

  // Función para renderizar los elementos del menú según el sesion.user.perfil
  const renderMenuItems = () => {
    const perfil = sesion.user.perfil;
    let menuItems = [];

    // Menú común para "Administrador"
    if (perfil === "Administrador") {
      menuItems.push(
        { title: 'Inicio', icon: <RiHomeFill />, link: 'inicio' },
        { title: 'Usuarios', icon: <RiUser3Fill />, link: 'usuarios' }
      );
    }

    // Menú común para "Administrador" y "Especial"
    if (perfil === "Administrador" || perfil === "Especial") {
      menuItems.push(
        { title: 'Tarifas', icon: <RiMoneyDollarCircleFill />, link: 'categorias' },
        { title: 'Ingresos', icon: <RiLoginCircleFill />, link: 'productos' },
        { title: 'Salidas', icon: <RiLogoutCircleFill />, link: 'salidas' }
      );
    }

    // Menú común para "Administrador" y "Vendedor"
    if (perfil === "Administrador" || perfil === "Vendedor") {
      menuItems.push(
        { title: 'Abonados', icon: <RiTeamFill />, link: 'clientes' },
        { title: 'Caja', icon: <RiShoppingCart2Fill />, link: 'cajas' },
        { title: 'Pagos', icon: <RiCurrencyFill />, link: 'crear-venta' }
      );

      if (perfil === "Administrador") {
        menuItems.push(
          { title: 'Reporte de ventas', icon: <RiLineChartFill />, link: 'reportes' }
        );
      }
    }

    return menuItems;
  };

  return (
    <div className="layout has-sidebar fixed-sidebar fixed-header">
      <aside id="sidebar" className="sidebar break-point-sm has-bg-image">
        <a id="btn-collapse" className="sidebar-collapser"><i className="ri-arrow-left-s-line"></i></a>
        <div className="image-wrapper">
          <img src="assets/images/sidebar-bg.jpg" alt="sidebar background" />
        </div>
        <div className="sidebar-layout">
          <div className="sidebar-header">
            <div className="pro-sidebar-logo">
              <div>P</div>
              <h5>Pro Sidebar</h5>
            </div>
          </div>
          <div className="sidebar-content">
            <nav className="menu open-current-submenu">
              <ul>
                <li className="menu-header"><span> GENERAL </span></li>
                {renderMenuItems().map((item, index) => (
                  <li className="menu-item" key={index}>
                    <a href={item.link}>
                      <span className="menu-icon">
                        {item.icon}
                      </span>
                      <span className="menu-title">{item.title}</span>
                    </a>
                  </li>
                ))}
              </ul>
            </nav>
          </div>
        </div>
      </aside>
      <div id="overlay"></div>
      <button id="btn-toggle">Toggle Sidebar</button>
    </div>
  );
};

export default Sidebar;
